import { useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { useLocation } from 'react-router-dom';
import { workouts } from './Home';
import Axios from 'axios';

const Edit = () => {
    const alertify = require('alertifyjs');
    const [selectedDate, setSelectedDate] = useState(null);
    const [name, setName] = useState('');
    const [exName, setExName] = useState('');
    const [getNew, setGetNew] = useState(false);
    const location = useLocation();

    const id = location.pathname.split('/')[2];
    let thisWorkout = [];
    workouts.forEach((workout) => {
        if(workout.id == id) thisWorkout = workout.exercises;
    });
    const [data, setData] = useState(thisWorkout);

    const handleDateChange = (e) => {
        setSelectedDate(e);
    };

    const handleNameChange = (e) => {
        setName(e);
    };

    const handleSubmit = () => {
        Axios.post('http://localhost3001/api/insert', {
            id: "ok",
            title: "ok",
            date: "ok",
            exercises: [],
        });
        console.log("submitted");
    };

    return (
        <div>
            <label>Title (optional):</label>
            <input type="text" value={name} onChange={handleNameChange}></input>
            <label>Date:</label>
            <DatePicker selected={selectedDate} onChange={handleDateChange} required={true}/>
            <button onClick={
                () => {
                    setGetNew(true);
                }
            }>Add Exercise</button>
            {getNew && <dialog open>
                <form onSubmit={(e) => {
                        const newExercise = {
                            "name": exName,
                            "sets": []
                        };
                        setData((data) => [...data, newExercise]);
                        setGetNew(false);
                        setExName('');
                    }}>
                    <label>Exercise Name: </label>
                    <input type="text" required={true} value={exName} onChange={(e) => {
                        setExName(e.target.value);
                    }}>
                    </input>
                    <button type="Submit">
                        OK
                    </button>
                </form>
                </dialog>}
            <div>
            {data.map((exercise, index) => {
                return (
                <div key={index}>
                    <div>{exercise.name}</div>
                    <div>
                        {exercise.sets.map((set, ind) => {
                            return (
                                <div key={ind}>
                                    <span>
                                        <label>Reps:</label>
                                        <input type="number" value={set[0]} onChange={(e) => {
                                            const newData = [...data];
                                            newData[index].sets[ind][0] = e.target.value;
                                            setData(newData);
                                        }}/>
                                    </span>
                                    <span>
                                        <label>Weight:</label>
                                        <input type="text" value={set[1]} onChange={(e) => {
                                            const newData = [...data];
                                            newData[index].sets[ind][1] = e.target.value;
                                            setData(newData);
                                        }}/>
                                    </span>
                                </div>
                            );
                        })}
                    </div>
                    <button onClick={() => {
                        const newData = [...data];
                        newData[index].sets.push([0, "0"]);
                        setData(newData);
                    }}>Add Set</button>
                </div>
                );
            })}
            </div>
            <a href="/">Cancel</a>
            <form onSubmit={handleSubmit}>
                <button type="Submit">OK</button>
            </form>
        </div>
    );
}

export default Edit;
